    return (
        <>
            <div className="content">
                <h1 className="home">HOME</h1>
                <br />
                <br />
                <p>Welcome to My Creative Playground: Exploring the Intersection of Art, Games, and Web Design!</p>
            </div>
            <Cards />
            <Footer />
        </>
    );
}

export default Home;
